        if iszero(eq(value, iszero(iszero(value)))) { revert(0, 0) }
    }
    function validator_revert_t_bytes4(value)
    {
        if iszero(eq(value, and(value, shl(224, 0xffffffff)))) { revert(0, 0) }
    }
}

